            for j in range(i, len(f)):
                sum += min(f[i:j + 1])
        return sum
    maxf = 1
    count = 0
    save = ()
    for x in itertools.permutations(range(1, n + 1)):
        t = countf(x)
        if t > maxf:
            maxf = t
            count = 0
        if t == maxf:
            count += 1
            if count == m:
                save = x
                break
    return list(save)

